ControlPropertyState.AutoRuleBindingString:
UpdateContext({
    varEditFormDepartamento_12: ThisItem
    });
UpdateContext({
    varVisibleFormDepartamento_12: true
})

// Atualiza a varivel de campos obrigatrios
UpdateContext({
    varFormDepartamentoCamposObrig_12:
        !IsBlank(DataCardValue14_1.Text) // Verifica se algum item foi selecionado
});

// SE os campos obrigatrios estiverem preenchidos...
If(
    varFormDepartamentoCamposObrig_12,

    // VERIFICA se o departamento J EST CADASTRADO
    If(
        !IsEmpty(
            Filter(sigd_departamentos, departamento = DataCardValue14_1.Text)
        ) && IsBlank(varEditFormDepartamento_12),

        Notify("Departamento j cadastrado", NotificationType.Information, 2000),

        SubmitForm(frm_departamentos_RH_2_2_3)),

    // CASO os campos obrigatrios NO estejam preenchidos
    Notify("Preencha todos os campos obrigatrios", NotificationType.Information, 2000)
)
